import React , {useEffect} from 'react'
import { NavLink  } from 'react-router-dom';
import {motion} from 'framer-motion';
import { GiTrophyCup } from "react-icons/gi";
import { FaClipboardList } from "react-icons/fa";
import { AiFillProfile } from "react-icons/ai";
import { IoBarChartSharp } from "react-icons/io5";
import { RiContactsBookFill } from "react-icons/ri";
import './Navbar.css';

const NavLinks =(props) =>{

    const animateFrom = {opacity : 0 , y :-40}
    const animateto = {opacity : 1 , y :1}
    return(


    <div className="navlinks">
       <ul >
  
                
  
               <motion.li
                 initial ={animateFrom}
                 animate={animateto}
               className="nav-item" onClick={() => props.isMobile && props.closeMobileMenu()}>
                  <NavLink className="nav-link" to="/" exact>
                    < GiTrophyCup /> البطولات
                  </NavLink>
                </motion.li>
    
                <motion.li
                initial ={animateFrom}
                animate={animateto}
                 className="nav-item" onClick={() => props.isMobile && props.closeMobileMenu()}>
                  <NavLink className="nav-link" to="/Matches" exact>
                  <FaClipboardList/> المباريات
                  </NavLink> 
                </motion.li>
  
                
  
                <motion.li 
                initial ={animateFrom}
                animate={animateto}
                className="nav-item" onClick={() => props.isMobile && props.closeMobileMenu()}>
                  <NavLink className="nav-link" to="/الأحصائيات" exact>
                  <IoBarChartSharp/> الأحصائيات
                  </NavLink> 
                </motion.li>

                <motion.li 
                initial ={animateFrom}
                animate={animateto}
                className="nav-item" onClick={() => props.isMobile && props.closeMobileMenu()}>
                    <NavLink className="nav-link" to="/الملاعب" exact>
                      <AiFillProfile/>   الملاعب
                         
                    </NavLink> 
                   </motion.li>
               
                
                <motion.li 
                initial ={animateFrom}
                animate={animateto}
                className="nav-item" onClick={() => props.isMobile && props.closeMobileMenu()}>
                  <NavLink className="nav-link"  to="/contact" exact>
                  <RiContactsBookFill/> Contact Us
                  </NavLink>
                </motion.li>
            </ul>
        </div>
       
     ) ;
}

export default NavLinks ;
